import React, { Component } from 'react';
import { users, addUser } from '../../model/store';

class App extends Component {

  style = {
    textAlign: 'center'
  }

  render() {
    return (
      <div style={this.style}>
        <h1>App component</h1>
        {users.map(user => <h4>{user.name}</h4>)}
      </div>
    );
  }
}

export default App;
